import React from 'react';

const Page404 = () => {
    return (
        <div className="page404">
            <script src="https://unpkg.com/@lottiefiles/lottie-player@latest/dist/lottie-player.js"></script>
            <lottie-player src="https://assets6.lottiefiles.com/packages/lf20_kjixtysj.json"  background="transparent"  speed="1"   loop controls autoplay></lottie-player>        </div>
    );
};

export default Page404;
